    First_Name VARCHAR,
    Last_Name VARCHAR,
    Employee_Address VARCHAR
);

CREATE TABLE DailyShipmentQuantityTop10 (
	StockItemID integer,
	QuantityShipped integer,
	InvoiceDate_Day date);

CREATE TABLE public.invoiceheader_2013_partial (
    invoiceid integer NOT NULL,
    invoicedate date NOT NULL,
    billtocustomerid integer NOT NULL,
    invoicelocationid integer NOT NULL
);

CREATE TABLE public.invoiceline_2013_partial (
    orderid integer NOT NULL,
    stockitemid integer NOT NULL,
    invoiceid integer NOT NULL,
    quantity integer NOT NULL,
    unitprice real NOT NULL,
    taxrate real,
    deliverymethodid integer NOT NULL,
    confirmeddeliverydate date
);


 
  SELECT  StockItemID, SUM(Quantity) AS QuantityShipped, DATE_TRUNC('day', InvoiceDate) AS InvoiceDate_Day
  FROM InvoiceLine_2013_Partial
  JOIN InvoiceHeader_2013_Partial USING(InvoiceID)
  WHERE StockItemID IN( SELECT StockItemID FROM InvoiceLine_2013_Partial GROUP BY StockItemID ORDER BY SUM(Quantity) DESC LIMIT 10)
  GROUP BY StockItemID, InvoiceDate_Day
  ORDER BY StockItemID, InvoiceDate_Day;
 
DROP TABLE IF EXISTS public.invoiceheader_2013_partial;
DROP TABLE IF EXISTS public.invoiceline_2013_partial;


